import React from "react";
import { Button } from "reactstrap";

export default function Tabs(props) {
  const [index, setIndex] = props.index

  return (
    <div>
      {
        props.names.map((name, idx) => {
          return (
            <Button
              color={index === idx ? "primary" : null}
              key={idx}
              onClick={()=>{setIndex(idx)}}
              style={{ borderRadius: `${idx === 0 ? 3 : 0}px ${idx === props.names.length - 1 ? 3 : 0}px 0px 0px` }}
            >
              {name}
            </Button>
          )
        })
      }
    </div>
  );
}
